use dep::std;
use utils::{
    get_array_slice, get_mrz_from_dg1, ID_CARD_MRZ_DOCUMENT_NUMBER_INDEX, is_id_card,
    PASSPORT_MRZ_DOCUMENT_NUMBER_INDEX,
};

pub fn compare_sig(
    dg1: [u8; 95],
    pub_key_x: [u8; 32],
    pub_key_y: [u8; 32],
    document_number_hash: [u8; 32],
    signature: [u8; 64],
) {
    let mrz = get_mrz_from_dg1(dg1);

    let mut document_number = [0 as u8; 9];

    if is_id_card(dg1) {
        document_number = get_array_slice(
            mrz,
            ID_CARD_MRZ_DOCUMENT_NUMBER_INDEX,
            ID_CARD_MRZ_DOCUMENT_NUMBER_INDEX + 9,
        );
    } else {
        document_number = get_array_slice(
            mrz,
            PASSPORT_MRZ_DOCUMENT_NUMBER_INDEX,
            PASSPORT_MRZ_DOCUMENT_NUMBER_INDEX + 9,
        );
    }

    // println(document_number);

    let mut padded_document_number = [0; 32];
    for i in 0..9 {
        padded_document_number[23 + i] = document_number[i];
    }

    let digest = std::hash::keccak256(padded_document_number, 32);

    // println(digest);
    assert(document_number_hash == digest);

    let valid_signature = std::ecdsa_secp256k1::verify_signature(
        pub_key_x,
        pub_key_y,
        signature,
        padded_document_number,
    );
    assert(valid_signature);
}

