    assert(date.sub_years(2).eq(Date::new(2021, 7, 14)));
    assert(date.sub_years(3).eq(Date::new(2020, 7, 14)));
    assert(date.sub_years(4).eq(Date::new(2019, 7, 14)));
    assert(date.sub_years(5).eq(Date::new(2018, 7, 14)));
}

